              if (this.password.trim() == '') {
                err += '密码不能为空;'
              }

              if (!this.isAgree) {
                err += '请先同意注册协议'
              }
              if (err != '') {
                Prompt.showToast({
                  message: err
                })
                return
              }
              console.log('wechat', this.nickName, this.country, this.phoneNumber, this.password, this.isAgree)
              router.back()
            })
        }
        .justifyContent(FlexAlign.Center)

      }
      .width('100%')
      .justifyContent(FlexAlign.Center)
